import{_ as e}from"./chunks/v5_nano_01.BFDPyset.js";import{_ as t,a}from"./chunks/cuav_nano_debug_cable.eKZAWBB0.js";import{_ as r,c as o,o as l,ab as i}from"./chunks/framework.CUflZczI.js";const k=JSON.parse('{"title":"CUAV V5 nano 자동조종장치","description":"","frontmatter":{},"headers":[],"relativePath":"ko/flight_controller/cuav_v5_nano.md","filePath":"ko/flight_controller/cuav_v5_nano.md"}'),n={name:"ko/flight_controller/cuav_v5_nano.md"},d=i('<h1 id="cuav-v5-nano-자동조종장치" tabindex="-1">CUAV V5 nano 자동조종장치 <a class="header-anchor" href="#cuav-v5-nano-자동조종장치" aria-label="Permalink to &quot;CUAV V5 nano 자동조종장치&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">PX4에서는 이 제품을 제조하지 않습니다. 하드웨어 지원과 호환 문제는 <a href="https://store.cuav.net/" target="_blank" rel="noreferrer">제조사</a>에 문의하십시오.</p></div><p><strong>V5 nano</strong><sup>®</sup>는 CUAV<sup>®</sup>와 PX4팀이 공동으로 설계한 공간 제약 애플리케이션용 자동조종장치입니다.</p><p>이 자동조종장치는 220mm 레이싱 드론에서 사용할 수 정도로 소형이지만, 대부분의 드론에도 충분히 사용할 수 있습니다.</p><p><img src="'+e+'" alt="V5 nano - 대표 이미지"></p><p>:::note V5 nano는 <a href="./../flight_controller/cuav_v5_plus.html">CUAV V5+</a>와 유사하지만 올인원 폼 팩터가 있고 PWM 포트가 더 적으며(AUX 포트를 사용하는 <a href="./../airframes/airframe_reference.html">기체</a>에는 사용할 수 없음), 내부 댐핑이 없습니다. :::</p><p>주요 기능은 다음과 같습니다.</p><ul><li><a href="https://pixhawk.org/" target="_blank" rel="noreferrer">Pixhawk 프로젝트</a> <strong>FMUv5</strong> 설계 표준과 호환되며, 외부 인터페이스에 <a href="https://pixhawk.org/pixhawk-connector-standard/" target="_blank" rel="noreferrer">Pixhawk 커넥터 표준</a>을 적용합니다.</li><li>더 안정적이고 신뢰할 수 있는 센서와 함께 FMU v3보다 고급 프로세서, RAM 및 플래시 메모리.</li><li>PX4와 펌웨어 호환.</li><li>I/O 핀을 위한 넉넉한 2.6mm 간격으로 모든 인터페이스를 더 쉽게 사용할 수 있습니다.</li></ul><p>:::note 이 비행 컨트롤러는 <a href="./../flight_controller/autopilot_manufacturer_supported.html">제조업체의 지원</a>을 받을 수 있습니다. :::</p><h3 id="요약" tabindex="-1">요약 <a class="header-anchor" href="#요약" aria-label="Permalink to &quot;요약&quot;">​</a></h3><p>메인 FMU 프로세서: STM32F765◦32 비트 Arm® Cortex®-M7, 216MHz, 2MB 메모리, 512KB RAM</p><ul><li><p>내장 센서 :</p><ul><li>가속도/자이로: ICM-20689</li><li>가속도/자이로: ICM-20602</li><li>가속/자이로: BMI055</li><li>자력계 : IST8310</li><li>기압계: MS5611</li></ul></li><li><p>인터페이스 : 8개의 PWM 출력</p><ul><li>FMU의 전용 PWM/캡처 입력 3 개</li><li>CPPM 전용 RC 입력</li><li>Spektrum/DSM 및 S.Bus 전용 R/C 입력</li><li>아날로그/PWM RSSI 입력</li><li>범용 시리얼 포트 4개</li><li>I2C 포트 3개</li><li>SPI 버스 4개</li><li>2개의 CAN 버스</li><li>배터리 전압/전류에 대한 아날로그 입력</li><li>2개의 추가 아날로그 입력</li><li>nARMED 지원</li></ul></li><li><p>전원 시스템: 파워 브릭 입력: 4.75 ~ 5.5V</p></li><li><p>USB 전원 입력: 4.75~5.25V</p></li><li><p>중량과 크기</p><ul><li>크기: 60<em>40</em>14mm</li></ul></li><li><p>기타 특성:</p><ul><li>작동 온도: -20 ~ 85°c (측정치)</li></ul></li></ul><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><p><a href="https://store.cuav.net/shop/v5-nano/" target="_blank" rel="noreferrer">CUAV Store</a></p><p><a href="https://www.aliexpress.com/item/33050770314.html?storeId=3257035&amp;spm=2114.12010612.8148356.9.dbe6790bjW2hpH" target="_blank" rel="noreferrer">CUAV 알리익스프레스</a>(국제 사용자)</p><p><a href="https://item.taobao.com/item.htm?spm=a230r.1.14.8.26ab5258veQJRu&amp;id=569404317857&amp;ns=1&amp;abbucket=13#detail" target="_blank" rel="noreferrer">CUAV Taobao</a> (중국 본토 사용자)</p><p>:::note Neo GPS 모듈과 함께 자동조종장치를 구매할 수 있습니다. :::</p><p><a id="connection"></a></p><h2 id="배선" tabindex="-1">배선 <a class="header-anchor" href="#배선" aria-label="Permalink to &quot;배선&quot;">​</a></h2><p><a href="./../assembly/quick_start_cuav_v5_nano.html">V5 nano 배선 퀵 스타트</a></p><h2 id="핀배열" tabindex="-1">핀배열 <a class="header-anchor" href="#핀배열" aria-label="Permalink to &quot;핀배열&quot;">​</a></h2><p><a href="http://manual.cuav.net/V5-Plus.pdf" target="_blank" rel="noreferrer">여기</a>에서 <strong>V5 nano</strong> 핀아웃을 다운로드하세요.</p><h2 id="펌웨어-빌드" tabindex="-1">펌웨어 빌드 <a class="header-anchor" href="#펌웨어-빌드" aria-label="Permalink to &quot;펌웨어 빌드&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">대부분의 사용자들은 펌웨어를 빌드할 필요는 없습니다. It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p><p>:::</p><p>이 대상에 대한 <a href="./../dev_setup/building_px4.html">PX4 빌드</a> 방법 :</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>make px4_fmu-v5_default</span></span></code></pre></div><p><a id="debug_port"></a></p><h2 id="디버그-포트" tabindex="-1">디버그 포트 <a class="header-anchor" href="#디버그-포트" aria-label="Permalink to &quot;디버그 포트&quot;">​</a></h2><p><a href="./../debug/system_console.html">PX4 시스템 콘솔</a>과 <a href="./../debug/swd_debug.html">SWD 인터페이스</a>는 <strong>FMU 디버그</strong> 포트에서 실행됩니다. 보드에는 I/O 디버그 인터페이스가 없습니다.</p><p><img src="'+t+'" alt="디버그 포트 (DSU7)"></p><p>디버그 포트(<code>DSU7</code>)는 <a href="https://www.digikey.com.au/product-detail/en/jst-sales-america-inc/BM06B-GHS-TBT-LF-SN-N/455-1582-1-ND/807850" target="_blank" rel="noreferrer">JST BM06B</a> 커넥터를 사용하며 다음과 같은 핀배열을 가집니다.</p><table><thead><tr><th>핀</th><th>신호</th><th>전압</th></tr></thead><tbody><tr><td>1 (적)</td><td>5V+</td><td>+5V</td></tr><tr><td>2 (흑)</td><td>DEBUG TX(출력)</td><td>+3.3V</td></tr><tr><td>3 (흑)</td><td>DEBUG TX(입력)</td><td>+3.3V</td></tr><tr><td>4 (흑)</td><td>FMU_SWDIO</td><td>+3.3V</td></tr><tr><td>5 (흑)</td><td>FMU_SWCLK</td><td>+3.3V</td></tr><tr><td>6 (흑)</td><td>GND</td><td>GND</td></tr></tbody></table><p>제품 패키지에는 <code>DSU7</code> 포트에 연결할 수 있는 편리한 디버그 케이블이 포함되어 있습니다. 이렇게 하면, <a href="./../debug/system_console.html">PX4 시스템 콘솔</a>을 컴퓨터 USB 포트에 연결하기 위한 FTDI 케이블과 SWD/JTAG 디버깅에 사용되는 SWD 핀이 분리됩니다. 제공된 디버그 케이블이 SWD 포트 <code>Vref</code> 핀 (1)에 연결되지 않습니다.</p><p><img src="'+a+'" alt="CUAV 디버그 케이블"></p><div class="warning custom-block"><p class="custom-block-title">SWD</p><p>Vref 핀 (1)은 Vref로 5V를 사용하지만, CPU는 3.3V에서 실행됩니다!</p><p>일부 JTAG 어댑터(SEGGER J-Link)는 Vref 전압을 사용하여 SWD 라인의 전압을 설정합니다. For direct connection to <em>Segger Jlink</em> we recommended you use the 3.3 Volts from pin 4 of the connector marked <code>DSM</code>/<code>SBUS</code>/<code>RSSI</code> to provide <code>Vtref</code> to the JTAG (i.e. providing 3.3V and <em>NOT</em> 5V).</p><p>더 자세한 내용은 <a href="#using-jtag-for-hardware-debugging">하드웨어 디버깅에 JTAG 사용</a>을 참고하십시오.</p></div><h2 id="시리얼-포트-매핑" tabindex="-1">시리얼 포트 매핑 <a class="header-anchor" href="#시리얼-포트-매핑" aria-label="Permalink to &quot;시리얼 포트 매핑&quot;">​</a></h2><table><thead><tr><th>UART</th><th>장치</th><th>포트</th></tr></thead><tbody><tr><td>UART1</td><td>/dev/ttyS0</td><td>GPS</td></tr><tr><td>USART2</td><td>/dev/ttyS1</td><td>TELEM1 (흐름 제어)</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>TELEM2 (흐름 제어)</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>TELEM4</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>TX는 SBUS_RC 커넥터의 RC 입력입니다.</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>디버깅 콘솔</td></tr><tr><td>UART8</td><td>/dev/ttyS6</td><td>연결되지 않음 (PX4IO 없음)</td></tr></tbody></table><h2 id="정격-전압" tabindex="-1">정격 전압 <a class="header-anchor" href="#정격-전압" aria-label="Permalink to &quot;정격 전압&quot;">​</a></h2><p><em>V5 nano</em> must be powered from the <code>Power</code> connector during flight, and may also/alternatively be powered from <code>USB</code> for bench testing.</p><div class="info custom-block"><p class="custom-block-title">The <code>PM2</code> connector cannot not be used for powering the <em>V5 nano</em> (see <a href="#compatibility_pm2">this issue</a>).</p></div><p>:::note 서보파워레일은 FMU에 의해 전원이 공급되지 않으며, 전원을 제공하지도 않습니다. 그러나, **+**로 표시된 핀은 모두 공통이며, BEC는 서보전원레일에 전원을 공급하기 위하여 모든 서보 핀 세트에 연결될 수 있습니다. :::</p><h2 id="과전류-보호" tabindex="-1">과전류 보호 <a class="header-anchor" href="#과전류-보호" aria-label="Permalink to &quot;과전류 보호&quot;">​</a></h2><p>The <em>V5 nano</em> has no over current protection.</p><p><a id="Optional-hardware"></a></p><h2 id="주변-장치" tabindex="-1">주변 장치 <a class="header-anchor" href="#주변-장치" aria-label="Permalink to &quot;주변 장치&quot;">​</a></h2><ul><li><a href="https://item.taobao.com/item.htm?spm=a1z10.3-c-s.w4002-16371268452.37.6d9f48afsFgGZI&amp;id=9512463037" target="_blank" rel="noreferrer">디지털 대기속도 센서</a></li><li><a href="https://cuav.taobao.com/category-158480951.htm?spm=2013.1.w5002-16371268426.4.410b7a821qYbBq&amp;search=y&amp;catName=%CA%FD%B4%AB%B5%E7%CC%A8" target="_blank" rel="noreferrer">텔레메트리 라디오 모듈</a></li><li><a href="./../sensor/rangefinders.html">거리계/거리 센서</a></li></ul><h2 id="지원-플랫폼-및-기체" tabindex="-1">지원 플랫폼 및 기체 <a class="header-anchor" href="#지원-플랫폼-및-기체" aria-label="Permalink to &quot;지원 플랫폼 및 기체&quot;">​</a></h2><p>일반 RC 서보 또는 Futaba S-Bus 서보로 제어 가능한 모든 멀티콥터/비행기/로버 또는 보트. 지원되는 운송체의 설정은 <a href="./../airframes/airframe_reference.html">기체 정의서</a>를 참고하십시오.</p><h2 id="호환성" tabindex="-1">호환성 <a class="header-anchor" href="#호환성" aria-label="Permalink to &quot;호환성&quot;">​</a></h2><p>CUAV는 몇 가지 차별화된 디자인을 채택하고, 아래에서 설명하는 일부 하드웨어와 호환되지 않습니다.</p><p><a id="compatibility_gps"></a></p><h4 id="neo-v2-0-gps는-다른-장치와-호환되지-않습니다" tabindex="-1">Neo v2.0 GPS는 다른 장치와 호환되지 않습니다. <a class="header-anchor" href="#neo-v2-0-gps는-다른-장치와-호환되지-않습니다" aria-label="Permalink to &quot;Neo v2.0 GPS는 다른 장치와 호환되지 않습니다.&quot;">​</a></h4><p>The <em>Neo v2.0 GPS</em> that is recommended for use with <em>CUAV V5+</em> and <em>CUAV V5 nano</em> is not fully compatible with other Pixhawk flight controllers (specifically, the buzzer part is not compatible and there may be issues with the safety switch).</p><p>UAVCAN <a href="http://doc.cuav.net/gps/neo-series-gnss/en/neo-v2-pro.html" target="_blank" rel="noreferrer">NEO V2 PRO GNSS 수신기</a>도 사용할 수 있으며, 다른 비행 컨트롤러와 호환됩니다.</p><p><a id="compatibility_jtag"></a></p><h4 id="하드웨어-디버깅에-jtag-사용" tabindex="-1">하드웨어 디버깅에 JTAG 사용 <a class="header-anchor" href="#하드웨어-디버깅에-jtag-사용" aria-label="Permalink to &quot;하드웨어 디버깅에 JTAG 사용&quot;">​</a></h4><p><code>DSU7</code> FMU 디버그 핀 1은 CPU의 3.3V가 아닌 5V입니다.</p><p>일부 JTAG 프로보는이 전압을 사용하여 타겟과 통신시 IO 레벨을 설정합니다.</p><p>For direct connection to <em>Segger Jlink</em> we recommended you use the 3.3 Volts of DSM/SBUS/RSSI pin 4 as Pin 1 on the debug connector (<code>Vtref</code>).</p><p><a id="compatibility_pm2"></a></p><h4 id="pm2는-비행-컨트롤러에-전원을-공급할-수-없습니다" tabindex="-1">PM2는 비행 컨트롤러에 전원을 공급할 수 없습니다. <a class="header-anchor" href="#pm2는-비행-컨트롤러에-전원을-공급할-수-없습니다" aria-label="Permalink to &quot;PM2는 비행 컨트롤러에 전원을 공급할 수 없습니다.&quot;">​</a></h4><p><code>PM2</code>는 배터리 전압과 전류만 측정 할 수 있고, 비행 컨트롤러에 전원을 공급할 수 <strong>없습니다</strong>.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4는이 인터페이스를 지원하지 않습니다.</p></div><h2 id="알려진-문제" tabindex="-1">알려진 문제 <a class="header-anchor" href="#알려진-문제" aria-label="Permalink to &quot;알려진 문제&quot;">​</a></h2><p>The issues below refer to the <em>batch number</em> in which they first appear. 배치번호는 V01 뒤의 4 자리 생산날짜이며 비행 컨트롤러 측면의 스티커에 표시되어 있습니다. 예를 들어, 일련 번호 Batch V011904((V01은 V5의 번호, 1904는 생산날짜, 즉 배치번호)입니다.</p><p><a id="pin1_unfused"></a></p><h4 id="sbus-dsm-rssi-인터페이스-pin1-언퓨즈" tabindex="-1">SBUS/DSM/RSSI 인터페이스 Pin1 언퓨즈 <a class="header-anchor" href="#sbus-dsm-rssi-인터페이스-pin1-언퓨즈" aria-label="Permalink to &quot;SBUS/DSM/RSSI 인터페이스 Pin1 언퓨즈&quot;">​</a></h4><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>이것은 안전에 관련된 문제입니다.</p></div><p>SBUS/DSM/RSSI 인터페이스에 다른 장비(RC 수신기 제외)를 연결하지 마십시오. 장비가 손상될 수 있습니다!</p><ul><li><em>Found:</em> Batches V01190904xxxx</li><li><em>Fixed:</em> Batches later than V01190904xxxx</li></ul><h2 id="추가-정보" tabindex="-1">추가 정보 <a class="header-anchor" href="#추가-정보" aria-label="Permalink to &quot;추가 정보&quot;">​</a></h2><ul><li><a href="http://manual.cuav.net/V5-nano.pdf" target="_blank" rel="noreferrer">V5 nano manual</a> (CUAV)</li><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">FMUv5 reference design pinout</a> (CUAV)</li><li><a href="https://github.com/cuav" target="_blank" rel="noreferrer">CUAV Github</a> (CUAV)</li><li><a href="./../frames_multicopter/dji_f450_cuav_5nano.html">DJI FlameWheel450에서 CUAV v5 nano를 사용하는 기체 빌드 로그</a></li></ul></div>',24),s=[d];function h(p,c,m,u,b,f){return l(),o("div",null,s)}const v=r(n,[["render",h]]);export{k as __pageData,v as default};
